import React, { Component } from 'react';
import { Collapse, Form, Tabs, Layout, Input, Row, Col, Button, DatePicker, Radio, Card } from 'antd';
import { Link } from "react-router-dom";
import { Menu, Dropdown, Icon } from 'antd';

const { Header, Sider, Content } = Layout;
const Panel = Collapse.Panel;
const FormItem = Form.Item;

class CreateNewRequest extends Component {

    constructor(props) {
        super(props);

    }


    render() {

        return (
            <div>
                <Layout>
                    <Header >
                        <Row>
                            <Col xs={6} sm={6} md={6} lg={6} xl={6}>
                                <Link to={{ pathname: "/home" }}>Back</Link>
                            </Col>
                            <Col xs={14} sm={14} md={14} lg={14} xl={14}>
                                <h3 className="color-white">CREATE NEW REQUEST</h3>
                            </Col>
                        </Row>
                    </Header>
                    <Content>
                        <Form>
                            <Row>
                                <Col xs={12} sm={12} md={12} lg={12} xl={12}>
                                    <Card >
                                        <FormItem label="Request Group">
                                            <Dropdown >
                                                <a className="ant-dropdown-link" href="#">
                                                    Hover me <Icon type="down" />
                                                </a>
                                            </Dropdown>
                                        </FormItem>

                                        <FormItem label="Request Type">
                                            <Input type="text" name="lastName" />
                                        </FormItem>

                                        <FormItem label="Request Group">
                                            <Input placeholder="Enter Name" />
                                        </FormItem>

                                        <FormItem label="Request Type">
                                            <Input type="text" name="lastName" />
                                        </FormItem>
                                    </Card>
                                </Col>
                            </Row>
                        </Form>


                    </Content>
                </Layout>
            </div >
        );
    }

}

export default CreateNewRequest;
